INSERT INTO `aboutus` VALUES (1,'من نحن ','Who Are We ?','<p style=\"text-align: right;\"><strong>ﻣ</strong><strong>ﻦ</strong><strong> ﻧﺤ</strong><strong>ﻦ</strong><strong> ؟</strong></p>\r\n<p style=\"text-align: right;\">ﻓﻲ ﻇﻞ ﺗﺰاﻳﺪ متطلبات اﻟﺤﻴﺎة ، واﻧﺸﻐﺎل أﻓﺮاد الأﺳﺮة ﻓﻲ أﻣﻮر ﺣﻴﺎﺗﻬﻢ ، ﻛﺎن ﻻﺑﺪ ﻣﻦ وﺟﻮد وﺟﻬﺔ رﺋﻴﺴﻴﺔ وﺳﻬﻠﺔ الاستخدام &nbsp;ﻟﺘﻠﺒﻴﺔ اﺣﺘﻴﺎﺟﺎت الأﺳﺮة ﻓﻲ ﻫﺬا اﻟﻌﺎﻟﻢ اﻟﺴﺮﻳﻊ اﻟﺬي ﻧﻌﻴﺶ ﻓﻴﻪ. ﻣﻦ ﻫﺬا اﻟﻤﺒﺪأ ﺗﻢ إﻧﺸﺎء ﻋﻼﻣﺔ (ﻣﻴﻢ أو ﻧﻮن ﻣﺎرﻛﺖ) ﻟﻠﺘﺠﺎرة اﻟﻌﺎﻣﺔ ، وﻫﻲ ﻋﻼﻣﺔ ﺗﺠﺎرﻳﺔ ﻛﻮﻳﺘﻴﺔ ٪١٠٠ ﺗﺴﻌﻰ إﻟﻰ ﺗﻮﻓﻴﺮﻣﺴﺘﻠﺰﻣﺎت الأﺳﺮة اﻟﺨﻠﻴﺠﻴﺔ ﻣﻦ ﻣﻼﺑﺲ وأﺣﺬﻳﺔ واﻛﺴﺴﻮارات ﻣﻨﺰﻟﻴﺔ ﺑﺘﺼﺎﻣﻴﻢ ﻋﺼﺮﻳﺔ ذات ﺟﻮدة ﻋﺎﻟﻴﺔ وأﺳﻌﺎر ﺗﻨﺎﻓﺴﻴﺔ ﻓﻲ ﻣﺘﻨﺎول اﻟﺠﻤﻴﻊ.<br /> <br /> ﻗﺮرﻧﺎ أن ﻧﺴﻌﻰ ﻓﻲ (ﻣﻴﻢ أو ﻧﻮن ﻣﺎرﻛﺖ) إﻟﻰ ﺗﻮﻓﻴﺮ اﻟﻮﻗﺖ اﻟﻤﺴﺘﻐﺮق واﻟﺠﻬﺪ اﻟﻤﺒﺬول ﻓﻲ ﻋﻤﻠﻴﺎت اﻟﺒﺤﺚ واﻟﺸﺮاء ﻟﻤﺴﺘﻠﺰﻣﺎت الأﺳﺮة اﻟﺨﻠﻴﺠﻴﺔ، ﺣﻴﺚ ﻳﻤﻜﻨﻜﻢ إﺗﻤﺎم ﻋﻤﻠﻴﺎت اﻟﺒﺤﺚ واﻟﺸﺮاء ﻻﺣﺘﻴﺎﺟﺎﺗﻜﻢ ﻓﻲ أي ﻣﻜﺎن وﻓﻲ أي وﻗﺖ ﻋﻦ ﻃﺮﻳﻖ موقعنا الالكتروني واﻟﺬي ﻳﺘﻤﻴﺰ ﺑﻮﺿﻮح اﻟﻌﺮض وﺳﻬﻮﻟﺔ الإﺳﺘﺨﺪام.&nbsp;</p>\r\n<p style=\"text-align: right;\"><span id=\"body\" class=\"ctr-p\"><a dir=\"rtl\" href=\"https://www.google.com.kw/setprefs?sig=0_6M2iDYN-KFu3TRTBEZVgr5oz7Xs%3D&amp;hl=ar&amp;source=homepage\">تست عربي</a></span></p>\r\n<p style=\"text-align: right;\"><strong>أهدافنا </strong><strong>:</strong></p>\r\n<ol style=\"text-align: right;\">\r\n<li>ﺗﻮﻓﻴر وﻗﺖ الأﺳﺮة اﻟﺨﻠﻴﺠﻴﺔ ﻓﻲ ﻋﻤﻠﻴﺔ اﻟﺒﺤﺚ واﻟﺸﺮاء ﻻﺣﺘﻴﺎﺟﺎت الأﺳﺮة اﻟﻤﺨﺘﻠﻔﺔ.</li>\r\n<li>دﻋﻢ ﻣﻴﺰاﻧﻴﺔ الأﺳﺮة ﻋﻦ ﻃﺮﻳﻖ ﻋﺮض اﻟﻤﻨﺘﺠﺎت ﺑﺄﺳﻌﺎر ﺗﻨﺎﻓﺴﻴﺔ.</li>\r\n<li>إﻧﺸﺎء ﻋﻼﻣﺔ (ﻣﻴﻢ أو ﻧﻮن ﻣﺎرﻛﺖ) اﻟﺘﺠﺎرﻳﺔ ﻟﻴﺮﺗﺒﻂ أﺳﻤﻬﺎ ﺑﺎلأﺳﺮة اﻟﺨﻠﻴﺠﻴﺔ.&nbsp;</li>\r\n</ol>\r\n<p style=\"text-align: right;\"><strong>ما الذي ﻧﺘﻤﻴ</strong><strong>ﺰ</strong><strong> ﺑﻪ ؟</strong></p>\r\n<p style=\"text-align: right;\">ﻣﺎﻳﻤﻴﺰﻧﺎ ﻫﻮ ﺿﻤﺎن أﻗﻞ الأﺳﻌﺎر ﻣﻘﺎرﻧﺔ ﻣﻊ ﺟﻮدة اﻟﻤﻨﺘﺞ ، ﺣﻴﺚ ﻧﺴﻌﻰ إﻟﻰ اﻟﺘﻮﻓﻴﺮ ﻓﻲ اﻟﺘﻜﻠﻔﺔ الإﺿﺎﻓﻴﺔ ﻋﻠﻰ اﻟﻤﻨﺘﺞ قدر المستطاع وذﻟﻚ ﺑﺎﺳﺘﺨﺪام وﺳﺎﺋﻞ ﺗﻐﻠﻴﻒ إﻗﺘﺼﺎدﻳﺔ ﻻ ﺗﺤﻤﻞ اﻟﻤﻨﺘﺞ ﺗﻜﻠﻔﺔ إﺿﺎﻓﻴﺔ ﻋﺎﻟﻴﺔ ، وﺑﺬﻟﻚ ﻧﺴﻌﺪ ﺑﺎﻟﻤﺴﺎﻫﻤﺔ ﺑﺪﻋﻢ اﺳﺮة ﻟﻠﺘﻮﻓﻴﺮ ﻓﻲ ﺗﻜﺎﻟﻴﻒ ﻣﺴﺘﻠﺰﻣﺎﺗﻬﺎ.<strong>&nbsp;</strong></p>\r\n<p style=\"text-align: right;\"><strong>المرونه في التعامل </strong></p>\r\n<p style=\"text-align: right;\">ﺳﻌﺎدة اﻟﻌﻤﻴﻞ و ارﺗﻴﺎﺣﻪ ﻣﻦ أﻫﻢ أوﻟﻮﻳﺎﺗﻨﺎ ، ﻟﺬﻟﻚ ﻧﻮﺟﺪ اﻟﻤﺮوﻧﺔ ﻓﻲ اﻟﺘﻌﺎﻣﻞ ﻋﻦ ﻃﺮﻳﻖ ﺗﻮﻓﻴﺮ (ﺳﻴﺎﺳﺔ الإﺳﺘﺮﺟﺎع) و (اﻟﺘﻮﺻﻴﻞ اﻟﻤﺠﺎﻧﻲ) داﺧﻞ دوﻟﺔ اﻟﻜﻮﻳﺖ ، وﺑﺬﻟﻚ ﻧﻀﻤﻦ رﺿﺎ اﻟﻌﻤﻴﻞ ﻋﻨﺪ ﻛﻞ ﻋﻤﻠﻴﺔ ﺷﺮاء.</p>','<p>Who Are We ?</p>\r\n<p>While life necessities increase, and family members get busy with their lives, there had to exist a major and easy tool to deliver family necessities in this fast-paced time we live in.</p>\r\n<p>Because of this principal, (MeemOnoon Market) trade mark general trading was established, and it is a 100% Kuwaiti company seeks to deliver quality and elegantly designed clothes, shoes, and home accessories at affordable prices for families in the gulf countries.</p>\r\n<p>We decided at (MeemOnoon Market) to efﬁciently save time and effort at the searching and purchasing of the products needed by families. You can complete a purchase anywhere, anytime by using the website (www.MeemOnoon.com) which was created to be easy to use and cleaerly display the products desired.</p>\r\n<p>Our Aims:</p>\r\n<ol>\r\n<li>Save time and effort for families in the gulf countries to look for and purchase their necessities.</li>\r\n<li>Deliver products at affordable prices to support the families&rsquo; budget.</li>\r\n<li>Establish (MeemOnoon Market) trade mark to be related to families in the gulf countries.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>What Makes Us Unique?</p>\r\n<p>What makes us unique is that we provide quality products at affordable prices. We achieve affordable prices by saving on over-valued packaging of products. This way we are able to support families&rsquo; Budget while providing quality products.</p>\r\n<p>Customer happiness and satisfaction are our priorities. That is why we offer ﬂexibility in dealing with customers by providing (refund policy), and (free delivery &ndash; in Kuwait). This way we assure customers to be satisﬁed with every purchase.</p>\r\n<p>&nbsp;</p>','2017-10-21 17:46:39','2017-11-04 18:37:56');
