INSERT INTO `privacy` VALUES (1,'هل ستبقى معلوماتي الشخصية سرية و آمنة؟','WILL MY PERSONAL INFORMATION BE KEPT PRIVATE?','<p>نحن في ميم أو نون ماركت ملتزمون تماما تجاه إبقاء معلوماتكم الشخصية سرية و آمنة و نتعهد بأن لا نستخدمها لأي غرض كان عدى مشاركة الأسم و العنوان فقط مع شركة آرامكس لإتمام و توصيل الطلب.</p>','<p>At MeemOnoon Market&nbsp; we are commited to keep your personal information safe and private and we pledge that we do not use your private information for any reasons other than using your Name and address with Aramex to complete and deliver your order.</p>','2017-10-21 18:31:01','2017-11-01 19:26:35');
