INSERT INTO `static_pages_questions` VALUES (1,3,'كيفية الطلب و الدفع:','How To Order & Pay:','     طريقتنا للطلب و الدفع بسيطة و سهلة جدا. بإمكانك أن تطلب من سوق ميم أو نون الإلكتروني بأي وقت تريد كالتالي:    1- تصفح و ابحث عن العناصر التي ترغب بشرائها.    2- عند إجادك لعنصر ترغب في شرائه, اضغط عليه لتتم إضافته إلى عربة التسوق        (بإمكانك إضافة عدد ما تريد من العناصر).    3- استعرض عربة التسوق و تابع للدفع.    4- إن كان لديك حساب لدى ميم أو نون, بإمكانك تسجيل الدخول, مراجعة الطلب من ثم الشراء.        إن لم يكن لديك حساب, أدخل عنوان التوصيل الذي ترغب به, راجع الطلب من ثم الشراء.        جميع عمليات الدفع في موقع ميم أو نون الإلكتروني ستتم من خلال شركة ماي فاتورة, ماي فاتورة هي شركة        كويتية تقبل جميع أنواع البطاقات الائتمانية.  لمعرفة المزيد عن شركة ماي فاتورة, اضغط هنا.','  Our Ordering and Payment is very simple and easy. You can Order anytime from   MeemoNoon market by:   1- Browsing and searching the items you wish to purchase.   2- When you find item you wish to purchase, one click to add it to the shopping cart       (you can add as many items as you want).   3- View your shopping cart and proceed to checkout.   4- If you are a registered customer you can sign in, review order and purchase. If you are        new customer, insert your address, review order and purchase. Purchases through        MeemoNoon  market will be processed by Myfatwra, Myfatwra, is a kuwaiti company        that accept all major credit and debit cards, for more info about Myfatwra click here.','2017-10-21 18:00:28','2017-10-21 18:00:28'),(2,3,'ماذا عن الطلبات السابقة ؟ ','What about Orders History ? ',' عند تسجيل حساب لدى موقع ميم أو نون يصبح بإمكانك تتبع طلباتك السابقة و إعادة طلبها مرة أخرى متى   شئت بطريقة سهلة و سريعة.','By registering at MeemoNoon, You can keep track of all the orders you made and reorder any of the items with only one click.','2017-10-21 18:12:49','2017-10-21 18:12:49'),(3,3,'كيفيه تتبع طلباتك؟ ','How  tack your order ? ','للطلبات خارج دولة الكويت, سنرسل بريد إلكتروني بعد تثبيت الطلب بفترة قصيرة يحتوي على رابط لموقع Aramex   بحيث يمكنك تتبع طلبك من هناك.','For orders outside Kuwait, We will provide you a link via E-mail to Aramex website To track your order.','2017-10-21 18:14:41','2017-10-21 18:14:41'),(4,3,'ما هي طرق الدفع المعتمدة لدينا ؟                                                                                                              ما هي طرق الدفع المعتمدة لدينا ؟                                                                                 ','What about Payments Methods?','داخل دولة الكويت:  بإمكانك الدفع بواسطة K-net  , الدفع عند الاستلام أو الدفع بواسطة البطاقات الائتمانية (ستتم معالجة الدفعات من خلال شركة ماي فاتورة الكويتية ).  دول الخليج الأخرى: بإمكانك الدفع بواسطة البطاقات الائتمانية (ستتم معالجة الدفعات من خلال شركة ماي فاتورة الكويتية).','Kuwait: We accept K-net, Payment on delivery and all major credit and debit cards (Processed by Myfatwra company).  Other Gulf countries: We accept all major credit and debit cards (Processed by Myfatwra company).','2017-10-21 18:17:57','2017-10-21 18:17:57'),(5,3,'التوصيل داخل دولة الكويت','SHIPPING INSIDE KUWAIT','معلومات التوصيل:  يتم توفير التوصيل المجاني داخل دولة الكويت إلى جميع المناطق و الأحياء.','  We ship to all areas in Kuwait via our company\'s carriers and free of any charges.','2017-10-21 18:19:29','2017-10-21 18:19:29'),(6,3,'أوقات التوصيل:','Shipping Times:','الطلبات قبل الساعة 9:00 مساءا: التوصيل يتم خلال 6 ساعات. الطلبات بعد الساعة 9:00 مساءا: التوصيل يتم في اليوم التالي بين الساعة 9:00-11:00 صباحا.',' Orders placed before 9:00 P.M: delivery within 6 hours.   Orders placed after 9:00 P.M: delivery next day between 9:00-11:00 AM.','2017-10-21 18:20:13','2017-10-21 18:20:13'),(7,3,'التوصيل لدول الخليج:','SHIPPING TO GULF COUNTRIES','معلومات التوصيل:  يتم توفي التوصيل إلى كافة مناطق و أحياء دول الخليج, المملكة العربية السعودية, الإمارات العربية المتحدة, قطر,  البحرين و عُمان من خلال آرامكس (    .(Aramex   وقت التوصيل:  المملكة العربية السعودية: التوصيل خلال 3 أيام. باقي دول الخليج: التوصيل خلال 24-48 ساعة','Shipping information:    We ship to all areas in KSA, UAE, QATAR, BAHRAIN and OMAN via Aramex.     Shipping Time:    KSA: delivery within 3 days.   Others: delivery within 24 - 48 Hours','2017-10-21 18:21:28','2017-10-21 18:21:28'),(8,3,'الرسوم الجمركية و الضرائب:','Duties & Taxes:','لزبائننا المتواجدين في دول الخليج, قد يكون هناك تكلفة جمركية و ضرائب تُدفع عند إستلام الطلب. تكلفة الرسوم الجمركية و الضرائب تتراوح حسب الدولة و الطلب. ','  Customers located in the gulf countries might have to pay additional duties & taxes upon   Receiving their orders. The duties and taxes rates depends on the shipment and country','2017-10-21 18:22:17','2017-10-21 18:22:17'),(9,2,'سياسة الاسترجاع','RETURN & REFUND INFORMATION','أي طلب تقوم به من خلال موقع ميم أو نون مؤهل و قابل للإرجاع عدى العطورات ، الرموش ، و المكياج.    بإمكانك استرجاع المنتج (القابل للارجاع ) من خلال تعبئة طلب الإرجاع الموجود في صفحة اتصل بنا وخلال مدة أقصاها ١٥ يوم من تاريخ استلام الطلب .    إذا ثبت استخدام المنتج المرتجع أو تعرضه لضرر ، فلن يتم ارجاع المبلغ .   إعادة المبلغ ستكون خلال أسبوع من استلامنا للمنتج .   يودع المبلغ في رقم الحساب المُدخل في طلب الإرجاع الموجود في صفحة اتصل بنا.  تخصم قيمة الشحن والتوصيل من المبلغ .','By registering at MeemoNoon, You can keep track of all the orders you made and reorder any of the items with only one click.','2017-10-21 18:35:29','2017-11-01 19:31:33');
/*!40000 ALTER TABLE `static_pages_questions` ENABLE KEYS */;
